import React, { Component } from 'react';
import Head from '../components/Head';
// import Map from '../components/map';
import {ReactComponent as ReactLogo }from '../components/Map.svg';

export default class Learn extends Component {
	render() {
		return (
			<div>
				<Head />
				<ReactLogo />
			</div>
		);
	}
}
